import React, { useState, useRef, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import './Navbar.css';

const Navbar = () => {
  const { user, logout, isAuthenticated, isFarmer, isBuyer } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [showDropdown, setShowDropdown] = useState(false);
  const dropdownRef = useRef(null);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const isActiveLink = (path) => {
    return location.pathname === path ? 'nav-link active' : 'nav-link';
  };

  const isActiveRoot = (path) => {
    return location.pathname.startsWith(path) ? 'nav-link active' : 'nav-link';
  };

  // Close dropdown when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setShowDropdown(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-content">
          <Link to="/" className="navbar-brand">
            <div className="brand-container">
              <img src="/logo.png" alt="Farmers Market" className="brand-logo" />
              <span className="brand-text">Farmers Market</span>
            </div>
          </Link>

          <div className="navbar-menu">
            {!isAuthenticated ? (
              <>
                <Link to="/" className={isActiveLink('/')}>
                  Home
                </Link>
                <Link to="/products" className={isActiveLink('/products')}>
                  Products
                </Link>
                <Link to="/about" className={isActiveLink('/about')}>
                  About
                </Link>
                <Link to="/contact" className={isActiveLink('/contact')}>
                  Contact
                </Link>
                <Link to="/login" className={isActiveLink('/login')}>
                  Login
                </Link>
                <Link to="/signup" className="btn btn-primary nav-btn">
                  Sign Up
                </Link>
              </>
            ) : (
              <>
                {isFarmer && (
                  <>
                    <Link to="/farmer/dashboard" className={isActiveRoot('/farmer/dashboard')}>
                      Dashboard
                    </Link>
                    <Link to="/farmer/products" className={isActiveRoot('/farmer/products')}>
                      My Products
                    </Link>
                    <Link to="/farmer/orders" className={isActiveRoot('/farmer/orders')}>
                      Orders
                    </Link>
                    <Link to="/farmer/sales" className={isActiveRoot('/farmer/sales')}>
                      Sales
                    </Link>
                  </>
                )}

                {isBuyer && (
                  <>
                    <Link to="/buyer/dashboard" className={isActiveRoot('/buyer/dashboard')}>
                      Dashboard
                    </Link>
                    <Link to="/products" className={isActiveLink('/products')}>
                      Browse
                    </Link>
                    <Link to="/buyer/orders" className={isActiveRoot('/buyer/orders')}>
                      My Orders
                    </Link>
                    <Link to="/buyer/cart" className={isActiveRoot('/buyer/cart')}>
                      Cart
                    </Link>
                  </>
                )}

                <div className="user-menu" ref={dropdownRef}>
                  <div
                    className="user-info"
                    onClick={() => setShowDropdown(!showDropdown)}
                    role="button"
                    tabIndex={0}
                    onKeyDown={(e) => {
                      if (e.key === 'Enter' || e.key === ' ') {
                        setShowDropdown(!showDropdown);
                      }
                    }}
                  >
                    <span className="user-avatar">
                      {user?.name?.charAt(0)?.toUpperCase() || 'U'}
                    </span>
                    <div className="user-details">
                      <span className="user-name">{user?.name || 'User'}</span>
                      <span className="user-role">{user?.role || 'Member'}</span>
                    </div>
                    <span className={`dropdown-arrow ${showDropdown ? 'open' : ''}`}>‚ñº</span>
                  </div>

                  <div className={`user-dropdown ${showDropdown ? 'show' : ''}`}>
                    <div className="dropdown-header">
                      <span className="dropdown-avatar">
                        {user?.name?.charAt(0)?.toUpperCase() || 'U'}
                      </span>
                      <div className="dropdown-user-info">
                        <span className="dropdown-name">{user?.name || 'User'}</span>
                        <span className="dropdown-email">{user?.email || ''}</span>
                      </div>
                    </div>
                    <div className="dropdown-divider"></div>
                    <Link
                      to="/profile"
                      className="dropdown-item"
                      onClick={() => setShowDropdown(false)}
                    >
                      <span className="dropdown-icon">üë§</span>
                      <span>My Profile</span>
                    </Link>
                    <Link
                      to={isFarmer ? '/farmer/dashboard' : '/buyer/dashboard'}
                      className="dropdown-item"
                      onClick={() => setShowDropdown(false)}
                    >
                      <span className="dropdown-icon">üìä</span>
                      <span>Dashboard</span>
                    </Link>
                    {isFarmer ? (
                      <Link
                        to="/farmer/settings"
                        className="dropdown-item"
                        onClick={() => setShowDropdown(false)}
                      >
                        <span className="dropdown-icon">‚öôÔ∏è</span>
                        <span>Settings</span>
                      </Link>
                    ) : (
                      <Link
                        to="/buyer/settings"
                        className="dropdown-item"
                        onClick={() => setShowDropdown(false)}
                      >
                        <span className="dropdown-icon">‚öôÔ∏è</span>
                        <span>Settings</span>
                      </Link>
                    )}
                    <div className="dropdown-divider"></div>
                    <button
                      onClick={handleLogout}
                      className="dropdown-item logout-item"
                    >
                      <span className="dropdown-icon">üö™</span>
                      <span>Logout</span>
                    </button>
                  </div>
                </div>
              </>
            )}
          </div>

          {/* Mobile Menu Button */}
          <button className="mobile-menu-btn" aria-label="Toggle menu">
            <span className="menu-line"></span>
            <span className="menu-line"></span>
            <span className="menu-line"></span>
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
